def add_new_providers(apps, schema_editor):
    Provider = apps.get_model('modules', 'Provider')
    for provider in new_providers:
        already_exists = Provider.objects.filter(name=provider['name'])
        if already_exists:
            logger.warning(f'Provider for {provider["name"]} already exists. Not recreating.')
        else:
            Provider.objects.create(name=provider['name'], description=provider['description'],
                                    logo_data_uri=provider['logo'])


